import React from "react";
import { styled } from "@mui/material/styles";
import { Box, Container, Grid, List } from "@mui/material";

const Fircon = styled("img")(({ theme }) => ({
  fontFamily: "Roboto",
  fontSize: "52px",
  fontWeight: 400,
  lineHeight: "68px",
  letterSpacing: "0em",

  [theme.breakpoints.down("sm")]: {
    fontFamily: "Roboto",
    fontSize: "26px",
    fontweight: 400,
    lineHeight: "34px",
    letterSpacing: "0em",
    textAlign: "center",
  },
}));

function Home2() {
  return (
    <div>
      <Fircon>MANAGEMENT & SERVICES COMPANY</Fircon>
    </div>
  );
}

export default Home2;
